//业务找货条件匹配
function showPYMatchList(input,data,key,value,func) {
	sortData(data,value);
	dropdownInput = input;
	g_func=func;
	var matchStr = $.trim($(input).val()).replace(/\s/g, "");
	
	var count = 0;
	var searchHtml="";
	$("#dropdown").remove();
//	if(data.length>0){
//		$("#dropdown").empty();   // 先清除该元素，防止出现多个
//	}else{
		searchHtml = "<div id='dropdown' class='show-layer' style='width:150px'>";
//	}
	searchHtml += "<ul>";
	$(data).each(function (i, e) {
		//如果是规格,数据不过滤,直接取后台模糊查询出来的数据
		if(e[value] == 'spec'){
			if (count < 10) {
				searchHtml += "<li><a href='javascript:;' ";
				searchHtml += " id='" + e[key] + "'";
				searchHtml += " name='" + e[value] + "'";
				searchHtml += " >";
				searchHtml += processStr(matchStr, e[value]);
				searchHtml += "</a></li>";
				count++;
			}
		}else if(value == 'basePriceName' && key == 'id'){//基价联想
			if (filter(e[value], matchStr)) {
				//只取10条
				if (count < 10) {
				searchHtml += "<li><a href='javascript:;' ";
				searchHtml += " id='" + e[key] + "'";
				searchHtml += " name='" + e[value] + "'";
				searchHtml += " dtype='1'";
				searchHtml += " categoryUuid='" + e.categoryUuid + "'";
				searchHtml += " category='" + e.category + "'";
				searchHtml += " factoryId='" + e.factoryId + "'";
				searchHtml += " factory='" + e.factory + "'";
				searchHtml += " >";
//				searchHtml += "<em class='label-orange white'>城</em>";
				searchHtml += processStr(matchStr, e[value]);
				searchHtml += "</a></li>";
				count++;
				}
			}
		}else{
			if (filter(e[value], matchStr)) {
				//只取10条
				if (count < 10) {
				searchHtml += "<li><a href='javascript:;' ";
				searchHtml += " id='" + e[key] + "'";
				searchHtml += " name='" + e[value] + "'";
				searchHtml += " >";
//				searchHtml += "<em class='label-orange white'>城</em>";
				searchHtml += processStr(matchStr, e[value]);
				searchHtml += "</a></li>";
				count++;
				}
			}
		}
	});
	 searchHtml += "</ul></div>";
//	 $("#dropdown").append($(searchHtml));
//	 $(document).append($("#dropdown"));
	 $("body").append(searchHtml);
	 setLayerPosition(input, $("#dropdown"));
	 controlLayerShow($("#dropdown"));
	 selectOption(input); 
	 onBlur(input);
}


//按字符串长度排序，防止有些名称短的匹配项不能出现在候选项中。
function sortData(data,value){
	data.sort(function(a, b) {
	    var va = a[value].length,
	        vb = b[value].length;
	    if (va > vb) {
	        return 1;
	    } else if (va < vb) {
	        return -1;
	    }
	});
}

//键盘选择模糊匹配结果
function selectOption(input){
	$(input).unbind("keydown").keydown(function (event) {
		if ($("#dropdown ul li").length > 0) {
			var index;
			if (event.keyCode === 38) {
				index = $("#dropdown ul li").has("a.hover").index();
				$("#dropdown ul li:eq(" + index + ") a").removeClass("hover");
				if (index === -1 || index === 0) {
					index = $("#dropdown ul li").length - 1;
				} else {
					index--;
				}
				$("#dropdown ul li:eq(" + index + ") a").addClass("hover");
			} else if (event.keyCode === 40) {
				index = $("#dropdown ul li").has("a.hover").index();
				$("#dropdown ul li:eq(" + index + ") a").removeClass("hover");
				if (index === -1 || index === $("#dropdown ul li").length - 1) {
					index = 0;
				} else {
					index++;
				}
				$("#dropdown ul li:eq(" + index + ") a").addClass("hover");
			} else if (event.keyCode === 13) {
				index = $("#dropdown ul li").has("a.hover").index();
				if (index > -1) {
					$("#dropdown ul li:eq(" + index + ") a").click();
					$(this).change();
					$("#dropdown .product-complete-ul").empty();
					$("#dropdown").hide();
					return false;
				}
				$(input).blur().focus();
			}
		}
		
	});
}

function onBlur(input){
	$(input).unbind("blur").blur(function(){
		setTimeout(function(){
			var inputVal=$.trim($(input).val()).replace(/\s/g, "");
			if(inputVal!==""){
				var found=false;
				$("#dropdown ul li a").each(function(){
					if($(this).text()==inputVal){
						$(this).click();
						found=true;
					}
				});
				if(!found){
					$(dropdownInput).attr("val","");
				}
			}else{
				$(dropdownInput).attr("val","");
			}
		},100);
		
	});
}


//控制显示浮层位置
function setLayerPosition(placeElement, offsetElement) {
	var offset = $(placeElement).offset();
	var offsetTop = $(placeElement).height() + offset.top + 10;
	var offsetLeft = offset.left;
	$(offsetElement).css({
		"top" : offsetTop,
		"left" : offsetLeft
	});
}

// 控制浮层显示隐藏
function controlLayerShow(showLayer) {
	$(".product-complete").hide();
	$(showLayer).show();
}

/*判断是否匹配*/
function filter(fullStr,matchStr){
	if($.trim(matchStr)===""){
		return true;
	}
	var result = false;
	if($.trim(fullStr)!=""){
		if(matchStr.hasChinese()){
			if(fullStr.toLowerCase().indexOf(matchStr.toLowerCase())>-1){
				result=true;
			}
		}else{
			var filters = convertToPY(fullStr);
			if(filters!=null){
				$(filters).each(function(i,e){
					if(e.toLowerCase().indexOf(matchStr.toLowerCase())===0){
						result=true;
						return false;
					}
				})
			}
		}

	}
	return result;
}
/**
 *@date:2015-05-05
 *@Modify-lastdate :2015-05-13
 *@author :Green.Ge
 *@describe：中文转成拼音首字母
 *@param: 要转换的汉字
 *返回值：转换后的拼音首字母
 *
 */
function convertToPY (str) {
	if (typeof (str) !== "string")
		throw new Error(-1, "函数makePy需要字符串类型参数!");
	var arrResult = [];
	for (var i = 0, len = str.length; i < len; i++) {
		var ch = str.charAt(i);
		arrResult.push(checkCh(ch));
	}
	return mkRslt(arrResult);
}


function checkCh(ch) {
	var uni = ch.charCodeAt(0);
	if (uni > 40869 || uni < 19968) {
		return ch;
	}
	return (oMultiDiff[uni] ? oMultiDiff[uni]
			: (strChineseFirstPY.charAt(uni - 19968)));
}

//判断字符串是不是中文
String.prototype.hasChinese = function () {
	var reg = /[^\x00-\xff]/ig;//判断是否存在中文和全角字符
//   var reg=/[A-Za-z]*[a-z0-9_-]|\s$/;//判断是否包含数字字母下划线  当使用这个时如果只有部分是中文字符还可以使用英文字体
	if (reg.test(this)) {
		return true;//存在中文
	}
	return false;//不存在中文
};
function mkRslt(arr) {
	var arrRslt = [ "" ];
	for (var i = 0, len = arr.length; i < len; i++) {
		var str = arr[i];
		var strlen = str.length;
		if (strlen === 1) {
			for (var k = 0; k < arrRslt.length; k++) {
				arrRslt[k] += str;
			}
		} else {
			var tmpArr = arrRslt.slice(0);
			arrRslt = [];
			for (var m = 0; m < strlen; m++) {
				var tmp = tmpArr.slice(0);
				for (var j = 0; j < tmp.length; j++) {
					tmp[j] += str.charAt(m);
				}
				arrRslt = arrRslt.concat(tmp);
			}
		}
	}
	return arrRslt;
}

