$(document).on("click","#dropdown a",function(){
	$(dropdownInput).val($(this).attr("name")).attr("val",$(this).attr("id"));
	if(g_func){
		//基价要传入整个选中的条
		if($(this).attr("dtype")=='1'){
			g_func($(this));
		}else{
			g_func($(this).attr("id"));
		}
		
	}
	$("#dropdown").hide();
});

//鼠标点击弹窗外，弹窗消失
$(document).click(function (event) { 
	var target = event.target;
	if($(target).attr("id") !== "dropdown"){
		$("#dropdown").hide();
	}
});
